import React, { Component } from 'react';
import "./index.css";

class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <p>Built by <a href="https://yangcs907.github.io/chrisyang907/index.html">CSY</a></p>
      </div>
    )
  };
};

export default Footer;
